query:
SELECT ?osmid ?distance ?loc ?tag WHERE {
  VALUES ?tag { "industrial" "depot" "military" "quarry" }
  ?osmid osmt:landuse ?tag . 
  SERVICE wikibase:around { 
      ?osmid osmm:loc ?loc . 
      bd:serviceParam wikibase:center "Point(12.925298 50.832261)"^^geo:wktLiteral . 
      bd:serviceParam wikibase:radius "15" . 
      bd:serviceParam wikibase:distance ?distance .
  } 
  FILTER(?distance < 15)
}
